def transform(sequence):
    count = {str(i): 0 for i in range(10)}
    transformed_sequence = ""

    for digit in reversed(sequence):
        if digit == "0":
            count["0"] += 1
        else:
            transformed_sequence = str(count[digit]) + transformed_sequence
            count[digit] = 0

    return transformed_sequence
